private void Awake()
{
    rb10 = GetComponent<Rigidbody>();
    gobj2 = new GameObject(); // Creating a new game object
    a2 = null; // Initializing a2 to null
}

private void Update()
{
    rb10.transform.Translate(4 * Time.deltaTime, 0, 0); // Fixing the translation values

    timer += Time.deltaTime;

    if (!instantiate_gobj && timer >= timeLimit)
    {
        a2 = Instantiate(gobj2); // Instantiating the game object
        timer = 0;
        instantiate_gobj = true;
    }
    else if (instantiate_gobj && timer >= timeLimit)
    {
        Destroy(a2); // Destroying the game object
        timer = 0;
        instantiate_gobj = false;
    }

    text.text = $"input: {OVRManager.hasInputFocus} - VR: {OVRManager.hasVrFocus}";
}
